    "insert" : "INSERT INTO `mystery_text` VALUES (4,'',1.00,2.00,3.00,4.00,3.00,3.00,0.00,3.00,'2016-03-18 14:32:37',55,2000002,18),(5,'上海知名日本料理店，位置不是很好找，但是生意火爆，经常排不上队。火爆了很多年。三文鱼很厚很嫩、牡丹虾、北极贝很新鲜，海螺鲜甜美味。价格虽然贵但是感觉超值，和他品质差不多的没他家便宜，和他家价格差不多的没他家品质好。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4.50,'2016-03-30 13:52:44',500,3000850,18),(6,'上海知名日本料理店，位置不是很好找，但是生意火爆，经常排不上队。火爆了很多年。三文鱼很厚很嫩、牡丹虾、北极贝很新鲜，海螺鲜甜美味。价格虽然贵但是感觉超值，和他品质差不多的没他家便宜，和他家价格差不多的没他家品质好。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4.50,'2016-03-30 14:56:47',500,3000851,18),(7,'在新世界百货负一楼，环境挺好，宽敞明亮。点的锅包肉外观金黄，个人感觉偏酸，甜味较轻。有机酸菜炖粉条汤汁可口，酸菜味浓，粉条晶莹剔透。白灼罗马生菜颜色翠绿，味咸鲜，口感适中，要是能把整棵生菜切开就更好了。最爱黄瓜虾仁水饺，虾仁鲜嫩，黄瓜清香，是我吃过最好吃的水饺了。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00,'2016-03-31 15:47:59',60,2001040,11),(8,'位置有点难找，店面较小，但生意很火爆。很爱他家的自家皮冻，晶莹剔透，爽滑，有弹性，咸鲜适中。白灼罗马生菜有点偏咸，生菜焯水时间有点过长。有机酸菜炖粉条里的虾仁太咸，整体偏咸。锅包肉酸甜适中，口感很好，颜色金黄稍微有点偏深。西芹猪肉水饺一般，没之前吃过的黄瓜虾仁水饺好吃。\\r\\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00,'2016-03-31 16:02:31',60,2001039,11),(95,'我来做个测试，这个麻辣烫就吃过一次，其实很一般，没觉着有啥了不起；名气倒不小，还如不一些地摊好吃；你要说干净卫生吧，口味不好也不行，对吧。。。。',4.00,4.00,3.00,3.00,3.00,3.00,NULL,3.00,'2016-04-28 15:27:39',10,1000044,14),(158,'生意不错，食材也很新鲜，潮汕火锅这两年发展很火，因为原汁原味，比拼的就是食材的好坏和新鲜度。汤底不错，清淡而不失鲜度，最爱手打牛丸和嫩牛肉。值得绕道去吃的店，希望品质坚持下去。',4.00,3.00,4.00,4.00,3.00,3.00,NULL,3.30,'2016-06-01 11:35:30',90,6000399,18),(176,'',3.00,3.00,3.00,3.00,3.00,3.00,1.00,2.80,'2016-06-07 10:33:06',666,1000012,12)",
